import React from 'react';
import { Routes, Route, Link, useLocation } from 'react-router-dom';

const PatientDashboard = () => {
  const location = useLocation();

  const navItems = [
    { name: 'Accueil', path: '/patient', icon: 'üè†' },
    { name: 'Rendez-vous', path: '/patient/rendez-vous', icon: 'üìÖ' },
    { name: 'Dossier', path: '/patient/dossier', icon: 'üìÅ' },
    { name: 'Consultations', path: '/patient/consultations', icon: 'ü©∫' }
  ];

  const DashboardHome = () => (
    <div className="p-8 bg-white rounded-xl shadow-sm border max-w-6xl mx-auto">
      <h1 className="text-3xl font-bold mb-4 text-gray-900">Bienvenue dans votre espace patient</h1>
      <p className="text-gray-600 mb-8 text-lg">S√©lectionnez une section dans le menu de gauche</p>
      <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
        <Link to="/patient/rendez-vous" className="p-6 bg-blue-50 border-2 border-blue-100 rounded-xl hover:shadow-md transition-all group">
          <div className="text-3xl mb-3">{/* ‚úÖ EMOJI au lieu de FiCalendar */}üìÖ</div>
          <h3 className="text-xl font-semibold text-blue-800 mb-2 group-hover:text-blue-900">Mes Rendez-vous</h3>
          <p className="text-blue-600 text-lg">G√©rez vos RDV m√©dicaux</p>
        </Link>
        <Link to="/patient/consultations" className="p-6 bg-green-50 border-2 border-green-100 rounded-xl hover:shadow-md transition-all group">
          <div className="text-3xl mb-3">{/* ‚úÖ EMOJI au lieu de FiStethoscope */}ü©∫</div>
          <h3 className="text-xl font-semibold text-green-800 mb-2 group-hover:text-green-900">Mes Consultations</h3>
          <p className="text-green-600 text-lg">Historique complet</p>
        </Link>
      </div>
    </div>
  );

  const MesRendezVous = () => (
    <div className="p-8 bg-white rounded-xl shadow-sm border max-w-6xl mx-auto">
      <h1 className="text-3xl font-bold mb-6 flex items-center gap-3">üìÖ Mes Rendez-vous</h1>
      <div className="grid gap-6">
        <div className="p-6 bg-blue-50 border-2 border-blue-100 rounded-xl">
          <h3 className="text-xl font-semibold mb-2">RDV 15 F√©vrier 14:00</h3>
          <p className="text-gray-600">Dr. Awa Ndiaye - Cardiologue</p>
        </div>
      </div>
    </div>
  );

  const MonDossier = () => (
    <div className="p-8 bg-white rounded-xl shadow-sm border max-w-6xl mx-auto">
      <h1 className="text-3xl font-bold mb-6 flex items-center gap-3">üìÅ Mon Dossier M√©dical</h1>
      <p>Votre historique m√©dical complet sera ici...</p>
    </div>
  );

  const MesConsultations = () => (
    <div className="p-8 bg-white rounded-xl shadow-sm border max-w-6xl mx-auto">
      <h1 className="text-3xl font-bold mb-6 flex items-center gap-3">ü©∫ Mes Consultations</h1>
      <div className="grid gap-6">
        <div className="p-6 bg-blue-50 border-2 border-blue-100 rounded-xl">
          <h3 className="text-xl font-semibold mb-2">Consultation 15 Janvier</h3>
          <p className="text-gray-600">Dr. Awa Ndiaye - Cardiologie</p>
        </div>
        <div className="p-6 bg-green-50 border-2 border-green-100 rounded-xl">
          <h3 className="text-xl font-semibold mb-2">Consultation 10 Janvier</h3>
          <p className="text-gray-600">Dr. Mamadou Diop - P√©diatrie</p>
        </div>
      </div>
    </div>
  );

  return (
    <div className="min-h-screen bg-gray-50">
      {/* Sidebar RESPONSIVE */}
      <div className="lg:w-64 lg:fixed lg:inset-y-0 lg:z-40 bg-white shadow-lg lg:block hidden h-screen border-r">
        <div className="p-6 border-b bg-gradient-to-b from-blue-50 to-white">
          <h1 className="text-2xl font-bold text-gray-900">Patient Portal</h1>
          <p className="text-sm text-gray-500 mt-1">Espace s√©curis√©</p>
        </div>
        <nav className="p-4 space-y-2 mt-4">
          {navItems.map(item => (
            <Link
              key={item.path}
              to={item.path}
              className={`flex items-center p-4 rounded-xl w-full transition-all duration-200 ${
                location.pathname === item.path
                  ? 'bg-blue-100 text-blue-800 border-r-4 border-blue-500 shadow-md font-semibold'
                  : 'text-gray-700 hover:bg-gray-100 hover:shadow-sm hover:translate-x-1'
              }`}
            >
              <span className="mr-4 text-2xl">{item.icon}</span>
              <span>{item.name}</span>
            </Link>
          ))}
        </nav>
      </div>

      {/* Main Content */}
      <div className="lg:ml-64 p-6 pb-20">
        <Routes>
          <Route path="/" element={<DashboardHome />} />
          <Route path="/rendez-vous" element={<MesRendezVous />} />
          <Route path="/dossier" element={<MonDossier />} />
          <Route path="/consultations" element={<MesConsultations />} />
          <Route path="*" element={<div className="text-center p-12 text-gray-500">Page non trouv√©e</div>} />
        </Routes>
      </div>
    </div>
  );
};

export default PatientDashboard;
